import React, { useEffect } from 'react'
import BootstrapTable from 'react-bootstrap-table-next';

export default function BookTable() {
    let [posts, setPosts] = useEffect([])

    const getPosts = () => {
        fetch('https://jsonplaceholder.typicode.com/posts')
            .then(Response => Response.json())
            .then(data => {
            console.log('posts', data)
            })
    }


    useEffect(() => {
        getPosts();
    
    },[])










    const columns = [{
        dataField: 'id',
        text: 'Product ID'
    }, {
        dataField: 'name',
        text: 'Product Name'
    }, {
        dataField: 'price',
        text: 'Product Price'
    }];


    const products = [{
        id: 1,
        name: 'Livro 1',
        price: 10
    },
    {
        id: 2,
        name: 'Livro 2',
        price: 50
    },
    {
        id: 3,
        name: 'Livro 3',
        price: 100
    }
    ]


    return (
        <div>
            <BootstrapTable keyField='id' data={products} columns={columns} />
        </div>
    )
}
